import logo from './logo.svg';
import './App.css';
import Login from "./pages/Login";
import { Route ,Routes} from "react-router-dom";
import Register from "./pages/Register";
import Home from "./pages/Home";
import Cookies from 'js-cookie';
import { withStore} from 'react-context-hook'
import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [loginstatus,setloginstatus]=useState(false);
  useEffect(()=>{axios.get('http://localhost:8089/api/auth/userstate',{
    withCredentials: true,
    headers: {
      "Access-Control-Allow-Origin": "http://localhost:8089",
      "Access-Control-Allow-Credentials": true
    }})
  .catch(e=>console.log(e))
  .then((res)=>{setloginstatus(res.data);
    console.log(res.data)})

},[loginstatus])
  return (

    <div className="App">


        <nav className="navbar navbar-expand-md navbar-dark bg-dark mb-4">
  <div className="container-fluid">
    <a className="navbar-brand" href="#">Top navbar</a>

    <div>
      <ul className="navbar-nav me-auto mb-2 mb-md-0">
        <li className="nav-item">
         if (condition) {
           <a className="nav-link active"  href="https://localhost:5091/api/auth/Login">Login</a>
         }

        </li>
        <li className="nav-item">
          <a className="nav-link active"  href="/Register">Register</a>
        </li>

      </ul>
      <form className="d-flex">
        <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
        <button className="btn btn-outline-success" type="submit">Search</button>
      </form>
    </div>
  </div>
</nav>


<>
<Routes>

<Route path="/" component={Home}/>
<Route  path="/Login" element={<Login/>}/>
<Route path="/Register" element={<Register/>}/>
</Routes>
</>




    </div>

  );
}

export default withStore(App);
